"""
Create a program that returns 'true' when a given number is a prime number.
"""
def is_prime(num):
    # Edge case 
    if num == 1:
        return False
    # Check from 2 to n-1 
    for i in range(2, num):
        if (num % i) == 0:
            return False
    return True

if __name__ == '__main__':
    num = int(input())
    print(is_prime(num))

